INSERT INTO `tt_title` (`Index`, `Topic`, `Added by`) VALUES (1,'When was the last time you tried something new?',0),(2,'Who do you sometimes compare yourself to? ',0),(3,'What is the most sensible thing you have ever heard someone say? ',0),(4,'What gets you excited about life? ',0),(5,'What life lesson did you learn the hard way? ',0),(6,'What do you wish you spent more time doing five years ago? ',0),(7,'Do you ask enough questions or do you settle for what you know? ',0),(8,'Who do you love and what are you doing about it? ',0),(9,'What is a belief that you hold with which many people disagree? ',0),(10,'What can you do today that you were not capable of a year ago? ',0),(11,'Do you think crying is a sign of weakness or strength? ',0),(12,'What would you do differently if you knew nobody would judge you? ',0),(13,'Do you celebrate the things you do have? ',0),(14,'What is the difference between living and existing? ',0),(15,'If not now, then when?',0),(16,'Have you done anything lately worth remembering? ',0),(17,'What does your joy look like today? ',0),(18,'Is it possible to lie without saying a word? ',0),(19,'If you had a friend who spoke to you in the same way that you sometimes speak to yourself, how long would you allow this person to be your friend?',0),(20,'Which activities make you lose track of time? ',0),(21,'If you had to teach something, what would you teach?',0),(22,'What would you regret not fully doing, being or having in your life?',0),(23,'Are you holding onto something that you need to let go of? ',0),(24,'When you are 80-years-old, what will matter to you the most?',0),(25,'When is it time to stop calculating risk and rewards and just do what you know is right? ',0),(26,'How old would you be if you did not know how old you are? ',0),(27,'Would you break the law to save a loved one? ',0),(28,'What makes you smile? ',0),(29,'When it is all said and done, will you have said more than you have done?',0),(30,'If you had the opportunity to get a message across to a large group of people, what would your message be?',0),(31,'If the average human lifespan was 40 years, how would you live your life differently?',0),(32,'What do we all have in common besides our genes that makes us human? ',0),(33,'If you could choose one book as a mandatory read for all high school students, which book would you choose?',0),(34,'Would you rather have less work or more work you actually enjoy doing? ',0),(35,'What is important enough to go to war over? ',0),(36,'Which is worse, failing or never trying?',0),(37,'When was the last time you listened to the sound of your own breathing? ',0),(38,'What is something you know you do differently than most people? ',0),(39,'Is doctor assisted suicide morally acceptable or morally wrong?',0),(40,'Would you rather be a worried genius or a joyful simpleton? ',0),(41,'If you could instill one piece of advice in the mind of a newborn baby, what advice would you give?',0),(42,'What is the most desirable trait another person can possess? ',0),(43,'What are you most grateful for? ',0),(44,'Is stealing to feed a starving child wrong? ',0),(45,'What do you want most? ',0),(46,'Are you more worried about doing things right, or doing the right things?',0),(47,'What has life taught you recently? ',0),(48,'What is the one thing you would most like to change about the world? ',0),(49,'Where do you find inspiration? ',0),(50,'Can you describe your life in a six word sentence? ',0),(51,'If we learn from our mistakes, why are we always so afraid to make a mistake?',0),(52,'What impact do you want to leave on the world? ',0),(53,'What is the most defining moment of your life thus far? ',0),(54,'In the haste of your daily life, what are you not seeing?',0),(55,'If life is so short, why do we do so many things we do not like and like so many things we do not do?',0),(56,'What lifts your spirits when life gets you down? ',0),(57,'Have you ever regretted something you did not say or do? ',0),(58,'Has your great